num.map((value,index) => {
	console.log(value+1);
	return (
	<li>{value}</li>
	);
})
};


function App() {
	console.log(FizzBang(numbers));
 return (
    <div className="App">
<ul className="fizzBuzz">
{FizzBang(numbers)}
